// ^^end of creating icons

// Create the top bar container
const topBar = document.createElement('div');
topBar.id = 'custom-topbar';
topBar.innerHTML = `
    <div class="search-bar">
        <form id="searchForm">
            <button type="submit" id="braveSearch" style="padding: 0; background-color: transparent; border: none; cursor: pointer;">
                ${braveSVG}
            </button>
            <input type="text" id="searchQuery" name="q" placeholder="Search with Brave or Google, check Google News, or ask AI...">
            <div class="buttons" style="display: flex; gap: 5px;">
                <button type="button" id="googleSearch" style="padding: 0; background-color: transparent; border: none; cursor: pointer;">
                    ${googlePNG}
                </button>
                <button type="button" id="googleNewsSearch" style="padding: 0; background-color: transparent; border: none; cursor: pointer;">
                    ${googleNewsPNG}
                </button>
                <button type="button" id="copilotSearch" style="padding: 0; background-color: transparent; border: none; cursor: pointer;">
                    ${copilotSVG}
                </button>
                <button type="button" id="chatGPTSearch" style="padding: 0; background-color: transparent; border: none; cursor: pointer;">
                    ${chatGPTSVG}
                </button>
            </div>
        </form>
    </div>
`;

// Style the top bar to ensure it's positioned correctly
topBar.style.position = 'fixed';
topBar.style.top = '0';
topBar.style.left = '50%'; // Start positioning from the center
topBar.style.transform = 'translateX(-50%)'; // Center the bar horizontally
topBar.style.width = '60%'; // Set the width to 50% of the page
topBar.style.zIndex = '10000'; // High z-index to ensure it's on top
topBar.style.backgroundColor = '#202124'; // Updated background color
topBar.style.borderRadius = '10px'; // Optional: Add a slight border-radius for aesthetics
topBar.style.padding = '5px'; // Add some padding to the top bar

// Add the top bar to the document
document.body.prepend(topBar);

// Style the form elements
const form = document.querySelector('.search-bar form');
form.style.display = 'flex';
form.style.alignItems = 'center';
form.style.justifyContent = 'space-between';
form.style.width = '100%';
form.style.backgroundColor = 'transparent'; // Make the form background transparent

// Adjust the Brave SVG as a background image inside the input field
const input = document.querySelector('.search-bar input[type="text"]');
input.style.flexGrow = '1';
input.style.margin = '0 10px'; // Space between the input and buttons
input.style.height = '48px'; // Adjust the height to match the buttons and the Brave icon size
input.style.paddingLeft = '60px'; // Increase padding to make space for the larger Brave icon
input.style.paddingRight = '10px'; // Extra padding to the right
input.style.backgroundImage = `url('data:image/svg+xml;base64,${btoa(braveSVG)}')`; // Use the Brave SVG as a background image
input.style.backgroundRepeat = 'no-repeat';
input.style.backgroundPosition = '10px center'; // Adjust position to overlap with the left edge of the input
input.style.backgroundSize = '44px 44px'; // Adjust the size to make it large enough to overlap the input
input.style.width = 'calc(100% - 100px)'; // Increase the width of the input field
input.style.border = 'none'; // Remove any borders around the input field
input.style.boxShadow = 'none'; // Remove any shadow around the input field

// Adjust the position and size of the icons on the right
const googleButton = document.getElementById('googleSearch');
googleButton.style.width = '28px'; // Adjust to make the Google icon larger
googleButton.style.height = '28px';
googleButton.style.backgroundSize = '28px 28px'; // Adjust the size of the Google icon

const googleNewsButton = document.getElementById('googleNewsSearch');
googleNewsButton.style.width = '28px'; // Adjust to make the Google News icon larger
googleNewsButton.style.height = '28px';
googleNewsButton.style.backgroundSize = '28px 28px'; // Adjust the size of the Google News icon

const buttons = document.querySelector('.search-bar .buttons');
buttons.style.display = 'flex';
buttons.style.gap = '5px'; // Maintain the gap between the icons
buttons.style.marginLeft = '-5px'; // Move the group of icons slightly to the left

// Center the form by adjusting its margin
form.style.margin = '0 auto';
form.style.width = 'calc(100% - 60px)'; // Reduce the form width to center it better

// Hide the Brave button since it's now part of the input's background
document.getElementById('braveSearch').style.display = 'none';

// Adjust body padding to account for the top bar height
document.body.style.paddingTop = '60px'; // Adjust this based on your bar's height

// Event listener for the search form to perform a Brave search when Enter is pressed
document.getElementById('searchForm').addEventListener('submit', function(event) {
    event.preventDefault(); // Prevent the default form submission behavior
    const query = document.getElementById('searchQuery').value;
    window.location.href = `https://search.brave.com/search?q=${encodeURIComponent(query)}`;
});

// Event listener for the Google News button
document.getElementById('googleNewsSearch').addEventListener('click', function() {
    const query = document.getElementById('searchQuery').value;
    window.location.href = `https://news.google.com/search?q=${encodeURIComponent(query)}`;
});

// Event listener for the Copilot button
document.getElementById('copilotSearch').addEventListener('click', function() {
    const query = document.getElementById('searchQuery').value;
    window.location.href = `https://www.bing.com/chat?sendquery=1&q=${encodeURIComponent(query)}&form=HECODX`;
});

// Event listener for the ChatGPT button
document.getElementById('chatGPTSearch').addEventListener('click', function() {
    const query = document.getElementById('searchQuery').value;
    window.location.href = `https://chat.openai.com/?q=${encodeURIComponent(query)}`;
});

// Event listener for the Google button
document.getElementById('googleSearch').addEventListener('click', function() {
    const query = document.getElementById('searchQuery').value;
    window.location.href = `https://www.google.com/search?q=${encodeURIComponent(query)}`;
});

// Function to adjust the placeholder text based on window size
function adjustPlaceholderText() {
    const searchBar = document.querySelector('.search-bar input[type="text"]');
    const windowWidth = window.innerWidth;
    
    // Adjust this value based on your design needs
    const minWidthForText = 1300
    if (windowWidth < minWidthForText) {
        searchBar.placeholder = ''; // Clear the placeholder text
    } else {
        searchBar.placeholder = 'Search with Brave or Google, check Google News, or ask AI...';
    }
}

// Call the function on initial load
adjustPlaceholderText();

// Listen for window resize events
window.addEventListener('resize', adjustPlaceholderText);

// Remove Old Searchbar element with class '.VISqTe.gb_9e.gb_fd'
const elements = document.querySelectorAll('.VISqTe.gb_9e.gb_fd');
elements.forEach(element => {
  element.remove();
});


// Wait until the DOM is fully loaded
document.addEventListener("DOMContentLoaded", function() {
    // Select the buttons using their class names
    const helpButton = document.querySelector('button[aria-label="Help"]');
    const settingsButton = document.querySelector('button[aria-label="Settings"]');

    // Select the search bar container
    const searchBar = document.querySelector('.search-bar form .buttons');

    if (helpButton && settingsButton && searchBar) {
        // Move the buttons to the end of the search bar
        searchBar.appendChild(helpButton);
        searchBar.appendChild(settingsButton);
    } else {
        console.error("Unable to find buttons or search bar.");
    }
});
